import React from 'react'
import { Swiper, SwiperSlide } from "swiper/react";
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';


function Testimonal() {
    return (
        <>
        <section>
            <div className="container">
                <div className="testimonal-top text-center text-white">
                    <h3 className='bm-0'>smiles and stories from</h3>
                </div>
                <div className="alums-tit text-center">
              <h2>Our Clients</h2>
            </div>
                <div className="customer-review">
                <Swiper
                        spaceBetween={10}
                        slidesPerView={5}
                        freeMode={true}
                        breakpoints={{
                          320: {
                            slidesPerView: 1
                          },
                          576: {
                            slidesPerView: 2
                          },
                          992: {
                            slidesPerView: 3
                          },
                          1200: {
                            slidesPerView: 4
                          }
                        }}
                        
                        onSlideChange={() => console.log("slide change")}
                        onSwiper={(swiper) => console.log(swiper)}
                        className="main_slider33"
                      >
                        <SwiperSlide>
                            <div className="patch-bname">
                                <h5>OUTLAST</h5>
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="patch-bname">
                                <h5>OUTLAST INFRA</h5>
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="patch-bname">
                                <h5>JENNIS CATERING</h5>
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>
                        <div className="patch-bname">
                                <h5>WHITE SHADOW ACADEMY</h5>
                            </div>
                        </SwiperSlide>
                      </Swiper>
                </div>
            </div>
        </section>
        </>
    )
}

export default Testimonal
